Heads held high in the sky!! 🇮🇳

The breathtaking moment holding the tricoloured flag on the Indians highest peak and world's third highest- Mt. Kanchenjunga 8586 M. 

One of the toughest, longest, strenuous and our highest mountain it is. 

Whatever it takes- but it's another level feeling holding the my indian flag🇮🇳.. 

Dedicated this climb to all the Frontline warriors of this pandemic..

